import ProfileCard from "./ProfileCard";
import style from './mystyle.module.css';

function App(){
  return (
      <div>
        <div className="row">
          <div ClassName={style.header}>Perofessional Experiences</div>
        </div>

        <div className="row">
          <div className="col-md-3">
            <ProfileCard />
          </div>
          <div className="col-md-6">
            <ProfileCard />
          </div>
          <div className="col-md-3">
            <ProfileCard />
          </div>
        </div>

      </div>
  );
}

export default App;
